import React, { Component } from 'react';

class HospitalRegistration extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: '',
      licenseNumber: '',
      contactInfo: '',
      loading: false,
      error: null,
      success: false,
      txHash: null
    };
  }

  handleInputChange = (e) => {
    const { name, value } = e.target;
    this.setState({ [name]: value });
  };

  registerHospital = async () => {
    const { name, licenseNumber, contactInfo } = this.state;
    const { contract, connectedWallet, sendTransaction } = this.props;

    if (!name || !licenseNumber || !contactInfo) {
      this.setState({ error: 'Please fill in all fields' });
      return;
    }

    if (!contract || !connectedWallet) {
      this.setState({ error: 'Smart contract or wallet not connected' });
      return;
    }

    try {
      this.setState({ loading: true, error: null, success: false });

      const receipt = await sendTransaction(
        contract.registerHospital,
        [name, licenseNumber, contactInfo]
      );

      console.log('Hospital registered successfully:', receipt.transactionHash);

      this.setState({
        loading: false,
        success: true,
        txHash: receipt.transactionHash,
        name: '',
        licenseNumber: '',
        contactInfo: ''
      });

      alert(`🏥 Hospital registered successfully!\nTx: ${receipt.transactionHash.slice(0, 10)}...`);

      // Redirect to dashboard
      this.props.onChangeView('dashboard');

    } catch (error) {
      console.error('Hospital registration failed:', error);

      let errorMessage = 'Hospital registration failed';
      if (error.message.includes('user rejected')) {
        errorMessage = 'Transaction cancelled by user';
      }

      this.setState({
        loading: false,
        error: errorMessage
      });
    }
  };

  render() {
    const { name, licenseNumber, contactInfo, loading, error } = this.state;

    return (
      <div className="hospital-registration">
        <div className="form-container">
          <h2>🏥 Hospital Registration</h2>
          <p>Register your hospital to start recording vaccinations on the blockchain.</p>

          {error && (
            <div className="error-message">
              ❌ {error}
              <button onClick={() => this.setState({ error: null })}>✕</button>
            </div>
          )}

          <div className="form-group">
            <label>Hospital Name *</label>
            <input
              type="text"
              name="name"
              value={name}
              onChange={this.handleInputChange}
              placeholder="e.g. City Health Clinic"
              required
            />
          </div>

          <div className="form-group">
            <label>License Number *</label>
            <input
              type="text"
              name="licenseNumber"
              value={licenseNumber}
              onChange={this.handleInputChange}
              placeholder="e.g. LIC-2023-001"
              required
            />
          </div>

          <div className="form-group">
            <label>Contact Info *</label>
            <input
              type="text"
              name="contactInfo"
              value={contactInfo}
              onChange={this.handleInputChange}
              placeholder="e.g. contact@hospital.org | +91-9876543210"
              required
            />
          </div>

          <div className="form-actions">
            <button
              onClick={this.registerHospital}
              disabled={loading || !name || !licenseNumber || !contactInfo}
              className="btn-primary"
            >
              {loading ? '⏳ Registering...' : '🏥 Register Hospital'}
            </button>

            <button onClick={this.props.onBack} className="btn-secondary">
              ← Back to Dashboard
            </button>
          </div>

          <div className="info-box">
            <p>🔐 After registration, an admin must authorize your hospital before you can record vaccinations.</p>
          </div>
        </div>
      </div>
    );
  }
}

export default HospitalRegistration;
